import React from 'react';
import TaskItem from './TaskItem'; // Importamos el componente TaskItem

const TaskList = ({ tasks, onToggle, onDelete }) => (
<ul>
  {tasks.map((task) => (
    <li key={task.id}>
      <TaskItem
        task={task}
        onToggle={onToggle}
        onDelete={onDelete}
      />
    </li>
  ))}
</ul>

);

export default TaskList;
